Fields allow us to define relationships between a given sigs and other components of our model. Each field in a sig has: a name ; a multiplicity (one, lone, pfunc, func, or, in the full Forge language, set); a type (a -> separated list of sig names) . Put together, a field takes the form: name: multiplicity type Example: Sig with one field Basic Sig with Fields (Linked List): A model of a circularly-linked list might have a sig called Node. Node might then have a field next: one Node to represent the contents of every Node's next reference. We use one here since every Node always has exactly one successor in a circularly linked list. sig Node { next: one Node
} Example: Sig with multiple fields Basic Sig with Fields (Binary Tree): A model of a binary tree might have a sig called Node. Node might then have three fields: left: lone Node and right: lone Node to represent the Node's children. We use lone here since the left/right child fields can either be empty or contain exactly one Node. val: one Int to represent the value of each Node, where we have decided that every Node should have an Integer value. We use one here because each Node should have exactly one value. sig Node { left: lone Node, right: lone Node, val: one Int
} (Int is a built-in sig provided by Forge. Read more about valid types , and Integers in Forge ). Example: Sig w/ No Fields Example - Basic Sig without Fields: Not every sig in a model needs to have fields to be a useful part of the model! sigs with no fields are often used in conjunction with other sigs that reference them. One such example might look like this: sig Student {}
sig Group { member: set Student
} Field names must be unique You cannot use the same field name within two different sigs in a model. This is because field names are globally available for writing constraints.

