The following three objects (Rectangle, Circle, and Polygon) are all instances of Shape. In general, all Shape objects include the following properties, all of which have corresponding setters and are typically optional parameters in the construction of these shapes: color: string - This is the color of the interior of the shape. borderWidth: number - This is the width of the border around the exterior of the shape, in pixels. borderColor: string - This is the color of the border of the shape. label: string - This is text to be displayed on top of the shape. All shapes come with an internal TextBox object, which is rendered according to this text in the center of the shape. labelColor: string - The color of the text that is displayed atop the shape. labelSize: number - The size of the label’s font, in pixels. Rectangle Rectangles work how one would expect them to. Along with the rest of the Shape variables, they also take in values of coordinates, height, and width. The coordinates will be in the typical form of the interface {x:<x position>, y:<y position>}. These coordinates will be the top left of the rectangle. The width and height parameters determine the size of the rectangle in the x and y direction, respectively. Circle Circles take in all the optional parameters associated with shapes, along with the additional parameters of coords and radius. The x and y values contained in the coords will determine the center of the circle, around which the radius will determine the rest. Polygon Polygons are a bit more complicated, and serve as a very general tool. Along with the standard optional shape parameters, they also take in a points parameter. This is in the form of an array of coordinates. Each coordinate should be a point on the outside of the polygon, traversing the outside of the desired shape in order. A simple triangle For example, a simple triangle could be rendered as follows: let points = [ {x: 100, y:100}, {x:100, y:200}, {x:200, y:100}
] let poly = new Polygon( points, "red"
) Line Lines work similar to Polygons, however without an interior. They also take in an array of coordinates called points, however these points will form a line, and will not reconnect at the end.

