A Grid provides a 2-dimensional array of cells that can store other visual objects. It is initialized by passing an object containing the following fields to its constructor: the location of the upper-left corner of the grid: grid_location: {x: upper-left-x-coordinate, y: upper-left-y-coordinate}; the size of each cell: cell_size: {x_size: width-per-cell, y_size: height_per_cell}; and the number of rows and columns: grid_dimensions: {x_size: number-of-columns, y_size: number-of-rows}. Add a visual object obj to a grid using its .add method: grid.add({x:column-index,y:row-index},obj) Cleaning Up the Array In the custom viz basics chapter, we built a simple script that printed out the contents of an array (for a model that defined such). Let's create a grid that displays the array contents more readably. We'll get the contents of the array as before, but this time we'll create a new text box for every entry, and store each in the grid. const stage = new Stage()
const theArray = instance.signature('IntArray').atoms()[0]
const elementsField = instance.field('elements')
const entries = theArray.join(elementsField) const arrayGrid = new Grid({ grid_location: {x: 50, y: 50}, cell_size: {x_size: 80, y_size: 40}, grid_dimensions: {x_size:1, y_size:10}}) entries.tuples().forEach( (entry,idx) => { arrayGrid.add({x: 0, y: idx}, new TextBox(`${entry}`, {x:100, y:100},'black',16))
}) stage.add(arrayGrid)
stage.render(svg, document) Note the call to entries.tuples(). The variable entries references a Forge expression---a piece of syntax that means something in the instance. To get that meaning into a list we can iterate over, we call the tuples() method. There's one problem remaining: we are creating a grid that always has 10 rows in it, no matter how many entries there are in the array. To fix this, we'll use entries.tuples().length in the grid definition: grid_dimensions: {x_size:1, y_size:entries.tuples().length}. Now we'll see a grid without any extra rows. Other container objects graphs trees edge objects with labels (new feature) conjoined objects
